import React from "react";

const Pokemon = ({ pokemon, releasePokemon }) => {
  return (
    <li>
      {pokemon.nickname} ({pokemon.species})
      <button className="release" onClick={() => releasePokemon(pokemon.id)}>
        Release
      </button>
    </li>
  );
};

export default Pokemon;
